(1531,1525,'Fireleaf',0,0,0,0,0,0,0,0,1,100,100,'',0,0,0,0,0,0,'art\\2D\\Items\\shag.png','This pipe herb is a gift from the gods themselves! The peasant is always keen to envelop himself in fragrant clouds of tobacco once his labor is done, as is the warrior after a battle. As is the worker after violence and maiming, or the king after the same... glory to the gods for this wondrous gift!',1,NULL,0,0),
